package br.com.peladafc.apppeladafc.model;import org.parceler.Parcel;/** * Created by renanjunior on 7/22/16. */@Parcelpublic class Time {    private int id;    private String nome;    public int getId() {        return id;    }    public void setId(int id) {        this.id = id;    }    public String getNome() {        return nome;    }    public void setNome(String nome) {        this.nome = nome;    }    public Time(String nome){        this.nome = nome;    }    public Time(){    }    @Override    public String toString() {        return "Time{" +                "id=" + id +                ", nome='" + nome + '\'' +                '}';    }}